from typing import List
from collections import deque

class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        for start in range(len(gas)):
            cur = start
            tank = gas[start]
            cnt = 0
            while cnt <= len(gas):
                print(start, cnt, tank)
                if tank < cost[cur]:
                    break
                tank -= cost[cur]
                cur = (cur + 1)%len(gas)
                tank += gas[cur]
                cnt += 1
            if cnt == len(gas)+1:
                return start
        print("-1")
        return -1

    # 2 pointer
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        profit = []
        start = 0
        for i in range(len(gas)):
            p = gas[i]-cost[i]
            profit.append(p)
            if not start and p > 0:
                start = i
        print(profit)
        
        p1, p2 = start, start
        tank = profit[start]
        cnt = 0

        back_flag = False
        queue = deque([])
        while cnt <= len(gas)+1:
            # print(tank, queue)
            cnt += 1
            if not back_flag:
                p2 = (p2 + 1)%len(gas)
                tank += profit[p2]
                if tank < 0:
                    queue.append(tank)
                    back_flag = True
            else:
                p1 = (p1 - 1) if p1 != 0 else len(gas)-1
                if profit[p1] <= 0:
                    queue.appendleft(profit[p1])
                else:
                    tmp = profit[p1]
                    tmp_q = 0
                    while queue:
                        tmp_q = queue.popleft()
                        tmp += tmp_q
                        if tmp < 0:
                            queue.appendleft(tmp)
                            break
                        elif tmp == 0:
                            break
                    if not queue:
                        back_flag = False
                        tank = tmp
                print("inner", p1, p2, back_flag, queue)
        print(p1, p2, start, queue, tank)
        if not queue and tank >= 0:
            return p1

        return -1

   # 2 pointer
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        profit = []
        start = 0
        for i in range(len(gas)):
            p = gas[i]-cost[i]
            profit.append(p)
            if not start and p > 0:
                start = i
    
        p1, p2 = start, start
        tank = profit[start]
        cnt = 0

        back_flag = False
        queue = 0
        while cnt <= len(gas):
            cnt += 1
            if not back_flag:
                p2 = (p2 + 1)%len(gas)
                tank += profit[p2]
                if tank < 0:
                    queue += tank
                    back_flag = True
            else:
                p1 = (p1 - 1) if p1 != 0 else len(gas)-1
                queue += profit[p1]
                if profit[p1] > 0 and queue >= 0:
                    back_flag = False
                    tank = queue
                    queue = 0
        if queue>=0 and tank >= 0:
            return p1

        return -1

